package main
import "fmt"
func main() {
    var qtnPessoas int
    fmt.Scan(&qtnPessoas)

    pessoasFila := make([]int, qtnPessoas)
    for i := 0; i < qtnPessoas; i++{
        fmt.Scan(&pessoasFila[i])
    }

    var qtdPessoasRemover int
    fmt.Scan(&qtdPessoasRemover)

    pessoasRemover := make(map[int]int, qtdPessoasRemover)
    for i := 0; i < qtdPessoasRemover; i++{
        var valor int
        fmt.Scan(&valor)
        pessoasRemover[i] = valor
    }

    for _, v := range pessoasRemover{
        fmt.Print(v)
    }


}
